svg.script:
	window.addEventListener("load", reloadSpecialStyles());

    function reload_fo(fedOcr){
		reloadSpecialStyles();
		var slides = document.getElementsByClassName('fo');
		for(index = 0; index < slides.length; index++)
			{
			   slides.item(index).style.opacity = '0';
			   slides.item(index).style.fillOpacity = '0';
			}
		var array = [10008, 10003, 10007, 10006, 10005, 10004, 10002, 10001, 10009];
		for (index = 0; index < array.length; ++index) {
				document.getElementById(array[index]).style.fill='#5D9A5D';
			}
		document.getElementById(fedOcr).style.fill='#ED9E00'; 
		document.getElementById('fo_'+fedOcr).style.opacity = '1';
		document.getElementById('fo_'+fedOcr).style.fillOpacity = '1';
		var ajax = new XMLHttpRequest();
			ajax.open("get", "/compare_budgets/subjects?ajax=1&fo="+fedOcr, true);
			ajax.send(/*"ajax=1&fo="+fedOcr*/);
			ajax.onload = function(e) {
			  parent.document.getElementById("municipality_list").innerHTML = ajax.responseText;
			}
	}
	 parent.document.getElementById("special-toolbar").onclick = function() {
        reloadSpecialStyles();
    };

	
	function reloadSpecialStyles(){
	    setTimeout(function(){
            var slides = document.getElementsByClassName('fo');
            var mode = getCookie('special_mode');
            var special_mode = (mode === '1');
            var defaultFontSize = 16;
            var font_size = getCookie('font_size');
            var font_name = getCookie('font_name');
            if(special_mode){
                if(typeof font_size !== 'undefined' && font_size !== '0' && font_size !== '1'){
                    font_size = parseFloat(font_size);
                    if(font_name === 'useSerif'){
                        font_size += 0.2;
                    }
                }
                for(index = 0; index < slides.length; index++){
                    if(typeof font_size !== 'undefined' && font_size !== '0' && font_size !== '1'){
                        font_size = parseFloat(font_size);
                        slides.item(index).setAttribute("font-size", Math.round( defaultFontSize * font_size ) );
                    }
                    else{
                        slides.item(index).setAttribute("font-size", ( defaultFontSize ) );
                    }
                    if(font_name === 'useSerif'){
                        slides.item(index).setAttribute("font-family", 'serif' );
                    }
                    else{
                        slides.item(index).setAttribute("font-family", 'Verdana' );
                    }
                }
            }
            else{
                for(index = 0; index < slides.length; index++){
                    slides.item(index).setAttribute("font-size", ( defaultFontSize ) );
                    slides.item(index).setAttribute("font-family", 'Verdana' );
                }
            }
		}, 500);
	}
	
	function getCookie(cname) {
        var name = cname + "=";
        var ca = document.cookie.split(';');
        for(var i=0; i<ca.length; i++) {
            var c = ca[i];
            while (c.charAt(0)==' ') c = c.substring(1);
            if (c.indexOf(name) == 0) return c.substring(name.length,c.length);
        }
        return "";
    }
